import NavBar from "../components/UI/NavBar"
import { animal } from '../interfaces/interfaces'
import Animals from '../components/Animals'
import { useEffect, useState } from "react";
import axios, { AxiosResponse } from "axios";


const duranimals: animal[] = [
    {
      animalId: 'e1',
      name: 'Toilet Paper',
    },
    {
      animalId: 'e2',
      name: 'Toilet Paper',
    },
    {
      animalId: 'e3',
      name: 'Toilet Paper',
    },
    {
      animalId: 'e4',
      name: 'Toilet Paper',
    },
  ];

export default function Animal() {

  const [respons, setResponse] = useState<animal[]>([])

 useEffect(() => {
  axios.get('https://localhost:7298/Animal/GetAnimals')
  .then((response: AxiosResponse) => {
    const animals: animal[] = response.data.map((responseItem: animal) => {
      return {
        animalId: responseItem.animalId,
        name: responseItem.name
      }
    })
    setResponse(animals)
  })
  .catch(error => {
    console.log(error);
  });

 }, [])

 const [articleId, setArticleId] = useState(null);

 useEffect(() => {

  const data = { name: 'Testt',  };
  axios.post('https://localhost:7298/Animal/CreateAnimal', data)
}, []);

async function componentDidMount() {
  // POST request using axios with async/await
  const article = { title: 'React POST Request Example' };
  const response = await axios.post('https://reqres.in/api/articles', article);
}
  return (
    <>
      <NavBar></NavBar> 
      <Animals items={respons}></Animals>
      <div>
        <button></button>
      </div>
    </>
  );

}
